The first dep path looks suspicious. It was traced back to https://crrev.com/c/2669359. In that CL the unittest third_party/blink/common/widget/screen_infos_mojom_traits_unittest.cc actually does not depend on `//services/viz/public/mojom:mojom`.

After removing that dep the linker error is gone. The update deps chains are:
```
//third_party/blink/common:blink_common_unittests --[private]-->
//third_party/blink/public/common:common --[public]-->
//third_party/blink/public/mojom:mojom_modules --[public]-->
//third_party/blink/public/mojom:mojom_core --[public]-->
//third_party/blink/public/mojom:mojom_platform --[public]-->
//third_party/blink/public/mojom/tokens:tokens

//third_party/blink/common:blink_common_unittests --[private]-->
//third_party/blink/public/common:common --[public]-->
//third_party/blink/public/mojom:mojom_modules --[public]-->
//third_party/blink/public/mojom:mojom_core --[public]-->
//services/viz/public/mojom:mojom --[public]-->
//third_party/blink/public/mojom/tokens:tokens

//third_party/blink/common:blink_common_unittests --[private]-->
//third_party/blink/common:common_unittests_sources --[private]-->
//third_party/blink/public/common:headers --[private]-->
//media/capture:capture_lib --[private]-->
//services/video_capture/public/mojom:mojom --[public]-->
//services/video_effects/public/mojom:mojom --[public]-->
//services/viz/public/mojom:mojom --> see private chain printed above...
```

So it looks like for the targets inside `//third_party/blink/common`, if they were to depend on "external" targets (e.g., viz), the dep chain have to to through `//third_party/blink/public/*`
